import FriendCard from "./FriendCard"

// function FriendList(props){

const FriendList = (props) => {

    console.log('friendlist props:',props)
    return (
        <table className="ui celled striped padded table">
          <tbody>
            <tr>
              <th>
                <h3 className="ui center aligned header">Name</h3>
              </th>
              <th>
                <h3 className="ui center aligned header">Phone #</h3>
              </th>
              <th>
                <h3 className="ui center aligned header">Email</h3>
              </th>
              <th>
                <h3 className="ui center aligned header">Next Appointment</h3>
              </th>
            </tr>

            {props.friendObjs.map(friend => {
              return (
              <FriendCard {...friend}/>
              )
            })}

          </tbody>
        </table>
      );
    };
export default FriendList
